import React, { Component } from 'react';
import Delete from '../../../../images/icons/trash.svg'
import Edit from '../../../../images/icons/edit.svg'

class UserListing extends Component {
    render() {
        const iconStyle = {
            width: 18,
            height: 18
          }
        return (
            <div>
                <form className="form-inline">
                    <a 
                    title={this.props.text} 
                    onClick={() => this.props.deleteUser()} 
                    className="mx-2">
                    <img style={iconStyle} src={Delete} /></a>
                    <a 
                    data-toggle="modal" 
                    data-target="#editUser" onClick={() => this.props.editUser()} className="mx-2"><img style={iconStyle} src={Edit} /></a>
                    <span className="text-muted mx-2">{this.props.text}</span>
                </form>
                
            </div>
        );
    }
}

export default UserListing;
